import { NavigationContainer } from "@react-navigation/native";
import { ConcellProvider } from "./src/context/Context";
import Main from "./Main";
import "react-native-gesture-handler";

function App() {
  return (
    <ConcellProvider>
      <NavigationContainer>
        <Main />
      </NavigationContainer>
    </ConcellProvider>
  );
}

export default App;
